import { createAction } from 'typesafe-actions';
import * as eventTypes from './eventTypes';
export const paymentDetailsRequestedEvent = createAction(eventTypes.PAYMENTS_PAYMENT_DETAILS_REQUESTED, resolve => (name, card, ccv, expiryMonth, expiryYear, address1, address2, city, postCode, country) => resolve({
  name,
  card,
  ccv,
  expiryMonth,
  expiryYear,
  address1,
  address2,
  city,
  postCode,
  country
}));
export const paymentDetailsReceivedEvent = createAction(eventTypes.PAYMENTS_PAYMENT_DETAILS_RECEIVED, resolve => data => resolve(data));
export const paymentDetailsErroredEvent = createAction(eventTypes.PAYMENTS_PAYMENT_DETAILS_ERRORED, resolve => error => resolve(error));
